// client/src/components/ViewAirplanes.jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function ViewAirplanes() {
  const [airplanes, setAirplanes] = useState([]);
  const [error,     setError]     = useState('');

  // 📥 Fetch function
  const fetchAirplanes = () => {
    console.log('🔄 Fetching airplanes…');
    axios.get('/api/airplanes')
      .then(res => {
        console.log('✅ Fetched airplanes:', res.data);
        setAirplanes(res.data);
        setError('');
      })
      .catch(err => {
        console.error('❌ Fetch error:', err.response?.data || err);
        setError(err.response?.data?.error || 'Failed to load');
      });
  };

  // initial load
  useEffect(() => {
    fetchAirplanes();
  }, []);

  return (
    <div>
      <h2>All Airplanes</h2>

      <pre style={{ background: '#f0f0f0', padding: '1em' }}>
        {JSON.stringify(airplanes, null, 2)}
      </pre>

      {/* Manual refresh */}
      <button onClick={fetchAirplanes} style={{ margin: '1em 0' }}>
        🔄 Refresh
      </button>

      {error && <p style={{ color: 'red' }}>{error}</p>}

      <table border="1" cellPadding="5">
        <thead>
          <tr>
            <th>AirlineID</th>
            <th>Tail Num</th>
            <th>Seat Cap</th>
            <th>Speed</th>
            <th>LocationID</th>
            <th>Plane Type</th>
            <th>Maintenanced</th>
            <th>Model</th>
            <th>Neo</th>
          </tr>
        </thead>
        <tbody>
          {airplanes.map((ap, i) => (
            <tr key={i}>
              <td>{ap.airlineID}</td>
              <td>{ap.tail_num}</td>
              <td>{ap.seat_capacity}</td>
              <td>{ap.speed}</td>
              <td>{ap.locationID}</td>
              <td>{ap.plane_type}</td>
              <td>{String(ap.maintenanced)}</td>
              <td>{ap.model}</td>
              <td>{String(ap.neo)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
